	add("barbarism", "{\"term\":\"barbarism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A barbaric act\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"These \u0027\u0027barbarisms\u0027\u0027 can not be allowed to continue; they must be crushed or civilization will collapse\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The condition of existing barbarically\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1879, \u0027\u0027William Tecumseh Sherman,\u0027 Address to the Michigan Military Academy\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"War\u0027\u0027 is at best barbarism... Its glory is all moonshine\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An error in language use within a single word, such as a mispronunciation\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2002, \u0027\u0027Hyman, \u0027Bad Grammar in Context\u0027, New England Classical Journal, 29, p. 94-10\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"In the jargon of the ancient grammarian, \u0027penacilin\u0027 would be a \u0027\u0027barbarism\", \"priority\":8}]}, \"synonyms\":{}}");

