	add("barbecue", "{\"term\":\"barbecue\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Spanish\", \"taino\"], \"text\":\"From Spanish \u0027barbacoa\u0027 from Taino \u0027barbakoa\u0027 (framework of sticks) the raised wooden structure the natives used to either sleep on or cure meat. Originally “meal of roasted meat or fish”.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fireplace or pit for grilling food, typically used outdoors and traditionally employing hot charcoal as the heating medium\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"We cooked our food on the \u0027\u0027barbecue\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A meal or event highlighted by food cooked in such an apparatus\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"We\u0027re having a \u0027\u0027barbecue\u0027\u0027 on Saturday, and you\u0027re invited\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Meat, especially pork or beef, which has been cooked in such an apparatus (i.e. smoked over indirect heat from high-smoke fuels) and then chopped up or shredded\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"She ordered a plate of \u0027\u0027barbecue\u0027\u0027 with a side of slaw\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A hog, ox, or other large animal roasted or broiled whole for a feast\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A floor on which coffee beans are sun-dried\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Andrew Gerald Gravette, \u0027Architectural Heritage of the Caribbean\u0027, page 227\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Drying the coffee beans took place in a \u0027\u0027barbecue\u0027\u0027, basically a large, flat platform, where the pulped coffee beans could be laid out and turned as they dried. Barbecues were often walled around and raised above ground level\", \"priority\":10}]}, \"synonyms\":{}}");

