	add("barbette", "{\"term\":\"barbette\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027barbette\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mound of earth or a platform in a fortification, on which guns are mounted to fire over the parapet\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027, \u0027The Great Game\u0027, Folio Society 2010, p. 276\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Cleverly camouflaged with grey felt, which exactly matched the colour of the walls, it led upwards to a \u0027\u0027barbette\u0027\u0027, or platform, perched beside the gate\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The inside fixed trunk of a warship\u0027s gun-mounting, on which the turret revolves. It contains the hoists for shells and cordite from the shell-room and magazine\", \"priority\":4}]}, \"synonyms\":{}}");

