	add("barge", "{\"term\":\"barge\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"coptic\", \"egyptian (ancient)\", \"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\"], \"text\":\"From Old french (842-ca. 1400) \u0027barge\u0027 (boat) from \u0027barca\u0027 from Ancient greek (to 1453) \u0027βάρις\u0027 (egyptian boat) from Coptic \u0027ⲃⲁⲁⲣⲉ\u0027 (small boat) from Egyptian (ancient) {{m|egy|sc\u003dLatn|*bēre}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large flat-bottomed towed or self-propelled boat used mainly for river and canal transport of heavy goods or bulk carg\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A richly decorated ceremonial state vessel propelled by rowers for river procession\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A large flat-bottomed coastal trading vessel having a large spritsail and jib-headed topsail, a fore staysail and a very small mizen, and having leeboards instead of a kee\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"One of the boats of a warship having fourteen oar\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The wooden disk in which bread or biscuit is placed on a mess tabl\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A double-decked passenger or freight vessel, towed by a steamboat\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A large omnibus used for excursions\", \"priority\":7}]}, \"synonyms\":{}}");

	add("bargain", "{\"term\":\"bargain\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\", \"frankish\", \"old french (842-ca. 1400)\", \"old high german (ca. 750-1050)\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) \u0027bargaynen\u0027 (to bargain, make a pledge for sale) from Anglo-norman \u0027bargaigner\u0027 from Old french (842-ca. 1400) \u0027bargaigner\u0027 from Frankish {{m|frk|*borganjan||to borrow, lend}}, from Proto-germanic {{m|gem-pro|*burgijaną||to borrow, lend}}, from Proto-indo-european {{m|ine-pro|*bhergh-||to protect, secure}}. Akin to Old high german (ca. 750-1050) \u0027boragen\u0027 \u0027borgen\u0027 (German \u0027borgen\u0027 () , Old english (ca. 450-1100) \u0027borgian\u0027 (to borrow, lend, pledge) More at borrow.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An agreement between parties concerning the sale of property; or a contract by which one party binds himself to transfer the right to some property for a consideration, and the other party binds himself to receive the property and pay the consideration\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A contract is a \u0027\u0027bargain\u0027\u0027 that is legally binding\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An agreement or stipulation; mutual pledge\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"And whon your honors mean to solemnize The \u0027\u0027bargain\u0027\u0027 of your faith\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An item (usually brand new) purchased for significantly less than the usual, or recommended, price; also (when not qualified), a gainful transaction; an advantageous purchase\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Thus the red damask curtains which now shut out the fog-laden, drizzling atmosphere of the Marylebone Road, had cost a mere song, and yet they might have been warranted to last another thirty years. A great \u0027\u0027bargain\u0027\u0027 also had been the excellent Axminster carpet which covered the floor\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The thing stipulated or purchased\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"She was too fond of her most filthy \u0027\u0027bargain\", \"priority\":8}]}, \"synonyms\":{}}");

