	add("barley", "{\"term\":\"barley\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027barli\u0027 \u0027barly\u0027 from Old english (ca. 450-1100) (adj.) {{m|ang|bærlīċ||barley-like}}, from \u0027bere\u0027 (barley) (compare Scots {{m|sc|bere||six-rowed barley}}), from Proto-germanic {{m|gem-pro|*baraz}} (compare Old Norse \u0027barr\u0027 , from Proto-indo-european {{m|ine-pro|*bʰars}}- ‘spike, prickle’ (compare Welsh \u0027bara|lang\u003dcy\u0027 () Latin \u0027far|lang\u003dla\u0027 () Serbo-Croatian {{m|sh|sc\u003dCyrl|бра̏шно}}/{{m|sh|brȁšno}} ‘flour’, Albanian \u0027bar|lang\u003dsq\u0027 () Ancient Greek \u0027φήρον\u0027 (plant deity) .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cereal of the species \u0027Hordeum vulgare\u0027, or its grains, often used as food or to make beer and other malted drinks\", \"priority\":1}]}, \"synonyms\":{}}");

