	add("barony", "{\"term\":\"barony\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The domain of a baron or baroness, usually as part of a larger kingdom or empire\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"an English administrative division originally reckoned as comprising 100 hides and in various numbers composing counties\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"W. Petty, \u0027The Political Anatomy of Ireland\u0027, page 326\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"In Ireland... an\u0026lt;!--sic--\u0026gt; head constable for each \u0027\u0027barony\u0027\u0027 or hundred, being 252\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1873\u0027\u0027, General Report on the Census of England, volume IV, page 181\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027Baronies\u0027\u0027 appear to have been formed successively on the submission of the Irish chiefs... the territory of each constituting a \u0027\u0027barony\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Any large manor or estate, regardless of its owner\u0027s rank\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The baronage: the body of barons in a realm\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Baronship, the rank or position of a baron\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The legal tenure of a baron\u0027s land; military tenure\", \"priority\":10}]}, \"synonyms\":{}}");

